;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"352\" height=\"352\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x1e497184 \"BufferedImage@1e497184: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@2c8bc19 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 352 height = 352 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; ## detect and enhance edges
;;; 
;;; - Reduce noise using a median filter
;;; - Create an edge mask using adaptive thresholding
;; **

;; @@

(def edge
  (-> img
    clone
    (resize! (new-size (.cols output) (.rows output)))
    (cvt-color! COLOR_RGB2GRAY)
    (median-blur! 7)
    (adaptive-threshold! 255 ADAPTIVE_THRESH_MEAN_C THRESH_BINARY 9 7)
    (cvt-color! COLOR_GRAY2RGB)))
(u/mat-view edge)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"352\" height=\"352\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x13fc1fe2 \"BufferedImage@13fc1fe2: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@2c8bc19 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 352 height = 352 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; ## Combine color image with edge mask
;; **

;; @@
(let [result (new-mat) ]
  (bitwise-and output edge result)
  (u/mat-view result))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"352\" height=\"352\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x7660d7e \"BufferedImage@7660d7e: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@2c8bc19 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 352 height = 352 #numDataElements 3 dataOff[0] = 2\"]"}
